Nobody could have predicted it. The Lego Movie, released way back in 2014, wasnt the hollow marketing exercise most expected. Instead, full of social satire, sharply subversive humour and a cast list comprised of talent from this decades most acclaimed sitcoms, it made a surprise commercial and critical blockbuster... while still selling a brick-tonne of toys. Alright, well stop with the puns before its too late.

&nbsp;

Five years later and the long-awaited sequel has finally hit our screens. Is it as awesome as the first time around? Well

&nbsp;

The film picks up instantly from the last film, when the Lego world was invaded by Duplo aliens, and then flashes forward five years. Set in a knowingly grittier landscape strongly influenced by Mad Max: Fury Road, the gang are now living in Apocalypseburg where everyone is gloomy except for our ever-optimistic hero Emmet (Chris Pratt). Life soon takes a turn for the worse as the original team is kidnapped and taken to the Systar System. You see, Queen Watevra Wa'Nabi plans on marrying the leader of Apocalypseburg. Of course, the only person who can save them is Emmet but is all what it seems?

Unfortunately, if youve seen the original Lego Movie, its probably exactly how you predict. Therere a few changes including particularly enjoyable parody of Pratts acting career in new character Rex Dangervest (hes a raptor training archaeologist cowboy galaxy defender now that hes lost the baby fat). Therere also more tunes but ultimately for The Lego Movie 2, the song remains the same. Enjoyable while playing but ultimately inconsequential. The jokes are there, the bright and busy world design is there, everything that did well the first time, but the story also follows the exact same beats. So much so youll swear youve just seen the same movie twice.

&nbsp;

Maybe its a case of high expectations but now that the surprise is gone, The Lego Movie 2 brings too few new toys to the table. Its a shame when the original is still so fun to play with.

&nbsp;

3/5

&nbsp;

Jordan Peeles directorial debut Get Out was the rarest of films a horror movie that drove in hordes of non-horror fans. It combined genuine thrills with a darkly funny core that won over almost everyone who saw it. It shouldnt have been a surprise, Peeles love of horror combined with his ongoing success with comedy partner Keegan-Michael Key provoked an impressive new voice in cinema. Of course, if youve done it once, expectations are high for the follow-up. Now Peele brings us Us. Not necessarily a direct sequel to Get Out but the next in Peeles line of social thrillers.

&nbsp;

Us flashes to different points in the life of Adelaide Thomas (Lupita Nyongo in one of her finest performances yet). We see a family vacation she took as a child including an eerie beachside house of mirrors. We see the aftermath of some mysterious trauma. Then most of the movie is spent with Adelaide as a mother. Her family has tripped out to the familys Santa Cruz beach house. They take an unsettling trip to that same beach Adelaide had seen as a child. Back at the house later that night, am enraged group breaks in and threatens Adelaides family. The intruders are exact doppelgangers out for vengeance.

&nbsp;

Going any further would be spoiler-ridden territory but once Us gets going its a non-stop thrill ride. The laughs are still prevalent, but this time Peele has evened out the comedy-horror quotient to 30/70. Get ready for the occasional jump scare and literally head-turning changes of pace because Us keeps you guessing. Which may be the only criticism of this movie. Us often feels like its pointing towards some deeper issue but it remains stubbornly elusive. Theres no easy answers and thats for better or worse. Youll likely leave the cinema carefully considering what it all means, theres already a world of conspiracies and fan analysis online, but you may never reach it.

&nbsp;

Us is a thoroughly successful follow up from Jordan Peele and proves Get Out was far from a fluke. Peele claims theres more social thrillers to follow, we cant wait for him to scare us again.

&nbsp;

4/5

