Run late to a Ross Noble show at your own risk. No matter whether you try boldly strutting through as if nothing was happening or attempting some weird hunched over jog  the man will notice. More than that, hell riff on your behaviour for a solid ten minutes, ultimately culminating in a mimed hunchback striptease to the tune of Tina Turners Private Dancer (only its Private Hunchback instead). As he frequently reminds us, Ross Noble shows reward two types of people  the punctual and those with a daft sense of humour.

&nbsp;

No two Ross Noble shows are alike. Hes a master of improv comedy and will frequently tangent off into the strangest of domains. One moment hes talking about a nasty case of chafing, another hes motioning to a pile of imaginary penguins to the side of stage (everyone looks over and he laughs heartedly at our expense). Well, that was our show at least. Yours will likely be completely different.

&nbsp;

Rumour is that Noble hits the stage with only four words on a piece of paper and the rest just comes from his surreal mind. Thats both the blessing and curse of what he does. Each show feels fresh and the chance that the show could head in any direction at any time is genuinely exciting. Its like hes playing free jazz with the absurd. This freewheeling approach unfortunately does lead to the occasional note that falls flat. Luckily such moments are often few and far between.

&nbsp;

Where Noble really shines is his crowd-work. He frequently encourages the interaction of anyone willing to step up and get involved. Whether hes battling multiple audience members over exactly what town theyre yelling at him (Toodyay) or exploring what gifts had been left on the stage (a long-time tradition at Noble shows  this time a bag of fruit and a blu-ray copy of his film Stitches.. from Video-Ezy.. with a note asking is it any good? We dont have enough HDMI cables). You can sense its an element of the show Noble gleefully looks forward to every night.

&nbsp;

Noble has been a frequent Australian visitor for years and shows no signs of slowing down anytime soon. Hes currently on a whirlwind tour of the country  and even if youve missed him, make sure you see him next time around. Youre guaranteed two full hilarious hours of inventive and unruly absurd comedy. Just make sure you run on time

