Sure, Christmas is still four months away, but if you have a particular appreciation for 90s sitcoms, we know exactly what will top your list this year The iconic Central Perk set from Friends is now more legendary than ever with its very own Lego set! Could we be any more excited?

&nbsp;

Thats right, you can build the very caf featured in all those classic episodes  from Phoebes performance area to that unforgettable orange couch and Gunthers counter. The set features tonnes of famous prop replicas including Joeys manbag and Rosss keyboard. Youll even find a few obscure in-jokes for the megafans (is that an Ichiban poster on the caf wall?).

&nbsp;

If you havent already raced to the Lego website, theres more the set would feel pretty empty without Lego versions of Ross, Rachel, Monica, Chandler, Joey, Gunther, and Princess Conseula Banana Hammock (or, yknow, Phoebe if you want to be boring). All its missing is Jack Geller, Janet and Marcel. Maybe next time!

&nbsp;

The set features 1070 pieces, and its available from September 1 for $89.99. Thats quite a steal after last years $650 Hogwarts castle! Even better, just add it to your list for Santa... or maybe, in this case, the Holiday Armadillo.

